import React from "react";
import "./styles/Slideshow.css";

function Slideshow() {
  return (
    <>
      <div class="slider">
        <div class="slide1" />
        <div class="slide2" />
        <div class="slide3" />
      </div>
    </>
  );
}

export default Slideshow;
